import './App.css';
import { Button } from 'react-bootstrap'
import "bootstrap/dist/css/bootstrap.min.css"

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
          <Button>Hello World</Button>
        </a>
      </header>
    </div>
  );
}

export default App;
